    var wsDiscTime = 0;

    function start(loc, psk) {
        var webSocket = new WebSocket(loc || settings.wsHost);
        var status = 0;
        var pauser = {
            elt: d3.selectAll(".play-pause-btn"),
            _buffer: [],
            unbuffer: function(d) {
                while (this._buffer.length > 0) {
                    this.insert(this._buffer.shift())
                }
                statsManager.redraw()
            },
            insert: function(d) {
                if (d.mode == 0) {
                    nodeModel.pushAttack(d)
                }
                statsManager.insert(d);
                for (var model in linkModels) {
                    linkModels[model].insert(d)
                }
                d.pruneTS = new Date().getTime() / 1000 + settings.pruneInterval;
                timestampedData.push(d)
            },
            push: function(d) {
                if (this.paused()) {} else {
                    this.insert(d);
                    statsManager.redraw()
                }
            },
            paused: function() {
                return false
            },
            toggle: function() {
                var dataset = this.elt.node().dataset,
                    nextText = dataset.next;
                dataset.next = this.elt.text();
                this.elt.text(nextText);
                if (this.paused()) {
                    this.elt.node().dataset.paused = "false";
                    this.unbuffer()
                } else {
                    this.elt.node().dataset.paused = "true"
                }
            }
        };
        webSocket.onopen = function() {
            wsDiscTime = 0;
            d3.select("#events-data").selectAll("tr.row").remove();
            webSocket.send(psk || settings.psk)
        };
        webSocket.onmessage = function(evt) {
            if (!evt) {
                return
            }
            var data = eval("(" + evt.data + ")");
            mesTemp = data.body ? data.body : mesTemp;
            if (data.type == 1) {
                var startLoc = projection([data.location.geoCoord[0], data.location.geoCoord[1]]);
                var datum = {
                    country: "CN",
                    city: data.location.name,
                    pseudoSmsTotal: data.pseudoSmsTotal,
                    dport: Math.floor(data.location.geoCoord[0] + data.location.geoCoord[1]),
                    latitude: data.location.geoCoord[1].toString(),
                    longitude: data.location.geoCoord[0].toString(),
                    mode: 0,
                    cx: startLoc[0],
                    cy: startLoc[1],
                    x: startLoc[0],
                    y: startLoc[1],
                    id: getID(),
                    datetime: (new Date()).toLocaleString().replace("T", "&ensp;"),
                    message: data.body ? data.body : "",
                    mobile: data.address,
                    pseudoSmsTotalProvince: data.pseudoSmsTotalProvince,
                    pseudoSmsTotal: data.pseudoSmsTotal
                };
                pauser.push(datum);
                if (status == 0 && typeof data.body != "undefined" && data.body != "") {
                    d3.select("#console-table-container").style("display", "block");
                    status = 1
                }
            } else {
                var pseudoSmsTotalCity = data.pseudoSmsTotalCity;
                var list = getArrayItems(pseudoSmsTotalCity, 200);
                for (var item in list) {
                    var tempdata = list[item];
                    var startLoc = projection([tempdata.location.geoCoord[0], tempdata.location.geoCoord[1]]);
                    var datum = {
                        country: "CN",
                        city: tempdata.location.name,
                        pseudoSmsTotal: data.pseudoSmsTotal,
                        dport: Math.floor(tempdata.location.geoCoord[0] + tempdata.location.geoCoord[1]),
                        latitude: tempdata.location.geoCoord[1].toString(),
                        longitude: tempdata.location.geoCoord[0].toString(),
                        cx: startLoc[0],
                        cy: startLoc[1],
                        x: startLoc[0],
                        y: startLoc[1],
                        mode: 1,
                        message: "",
                        pseudoSmsTotalProvince: data.pseudoSmsTotalProvince,
                        id: getID(),
                        datetime: (new Date()).toLocaleString().replace("T", "&ensp;")
                    };
                    pauser.push(datum)
                }
                document.getElementById("mes").html = data.pseudoSmsTotal
            }
            d3.select("#mes ").html(function() {
                var charArr = data.pseudoSmsTotal.toString().split("");
                var numHtml = "";
                for (item in charArr) {
                    numHtml += '<span class="num">' + charArr[item] + "</span>"
                }
                return numHtml
            })
        };
        webSocket.onclose = function() {
            var interval = 500;
            wsDiscTime += 500;
            d3.select("#events-data").selectAll("tr.row").remove();
            if (wsDiscTime > settings.wsTimeout) {
                showMessage("服务出现故障，请稍后再试");
                wsDiscTime = 0
            }
            setTimeout(function() {
                console.log("websocket closed, reconnecting in " + interval + "ms");
                start(loc, psk)
            }, interval)
        };
        return webSocket
    }
